def expand_euclid(u1,u2):
    if u1>u2:
        a=u1
        b=u2
    else:
        a=u2
        b=u1
    if b==0:
        return 1
    x1=1
    y1=0
    x2=0
    y2=1
    while True:
        r=a%b
        q=a//b
        x3=x1-(q*x2)
        y3=y1-(q*y2)
        x1=x2
        x2=x3
        y1=y2
        y2=y3
        if r==0:
            break
        a=b
        b=r
    kai=[b,y1,x1]
    return kai

